def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    parts = input1.split()
    transformed_parts = []
    for part in parts:
        segments = part.split('-')
        transformed_segments = [segments[0]]
        for segment in segments[1:]:
            transformed_segments.append(segment.capitalize())
        transformed_parts.append(''.join(transformed_segments))
    return ' '.join(transformed_parts)
